import logo from './logo.svg';
import './App.css';

const data = [
  { name: "Verb Vanilla Latte", price: "Mexican", uber: "No", alph: 2, id: 1, close: 6},
];

function App() {
  return (
    <div className="App">
      <ProductList list={data} />
    </div>
  );
}

export default App;
